import React from 'react'
import { NavLink } from 'react-router-dom';

const Cards = ({detail}) => {
    console.log(detail);
  return (
    <div className='meals'>
        {
           !detail ? "Sorry Data Not Found" : detail.map((curItem,index)=>{
            console.log(curItem)
                return(
                    <div className='mealImg'>
                    <img src={curItem.title}/>
                    <p>{curItem.id}</p>
                    <NavLink to={`/${curItem.id}`}> <button >Recipe </button></NavLink>
                    
                    </div>
                )
            })
        }
    </div>
  )
}

export default Cards
